import { Link } from 'react-router-dom';

function Navbar(props) {
    return (
        <>
        <nav>
            <Link to="/">Home</Link>
            <Link to="/tours">Tours</Link>
            <Link to="/tour">Tours</Link>

        </nav>
    </>
    )
}

export default Navbar;
